import {Switch, Route} from 'react-router-dom'
import IndexPage
 from '../pages/IndexPage/IndexPage'

const Routes = () => {

    return(
        <Switch>
            <Route path = '/' exact render = { () => <IndexPage/> } />
            <Route path = '/phones' render = { () => <PhonesPage/>} />
        </Switch>
    )
}

export default Routes
